import React from 'react';
import { View, Text, StyleSheet, Pressable } from 'react-native';

export function Home({ navigation }) {  // Wir nehmen `navigation` aus den Props, um zu anderen Bildschirmen zu navigieren.
  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.heading}>Willkommen bei TSM2.0</Text>
        <View style={styles.buttonsContainer}>
          <Pressable style={styles.button} onPress={() => navigation.navigate('SignUp')}>
            <Text style={styles.buttonText}>Sign Up</Text>
          </Pressable>
          <Pressable style={styles.button} onPress={() => navigation.navigate('Login')}>
            <Text style={styles.buttonText}>Login</Text>
          </Pressable>
        </View>
      </View>
      {/* Hier könnten weitere Elemente wie Benachrichtigungen, Links zu anderen Funktionen etc. hinzugefügt werden */}
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  header: {
    width: '100%',
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'space-between',
    paddingHorizontal: 15,
    paddingBottom: 10
  },
  heading: {
    fontSize: 24,
  }
});
